  false,\n\t\"url\": null,\n\t\"notes\": \"EM300 and EM3002D multibeam Data were collected
  on 19-24 April, and 28 April - 11 May 2006 aboard NOAA Ship Hi'ialakai in the Main
  Hawaiian Islands at Penguin Bank, N. Shore Molokai, Lanai, and the Big Island of
  Hawaii during cruise HI-06-05. These multibeam data were collected using SAIC ISS-2000
  software in the Generic Sensor Format and processed using SABER editing software.
  Surface sound velocity values were supplied by a Seabird SBE-45 MicroTSG and a SBE-38
  remote temperature probe. Sound velocity corrections from a Seabird 911 CTD sensor
  and motion corrections from a POS-MV vertical reference were applied to the data
  in real time. Predicted tides were applied to the data in real time and observed
  tides were applied during post-processing. Horizontal accuracy is 5 m (differential
  GPS correctors applied), vertical accuracy is depth dependent (~1% of water depth),
  WGS84 datum. These data are not to be used for navigation. Depths mapped range from
  20-2000 m. Concurrent mapping was done by the R/V AHI in water depths ranging from
  10-300 m with the data set being AHI-06-05; metadata for AHI-06-05 are submitted
  separately.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
